import React from 'react';

const Rank = ({name, entries}) => {
    return(
        <div>
            <div className='white f2 fw6'>
                {`${name} , your current rank is...`}
                <div className='white f1 '>
                {entries}
                </div>
            </div>
            <div className='white f1 fw6'>
                {'#5'}
            </div>
        </div>   
    );
}

export default Rank;
